// src/components/CropPrediction.js
import React, { useState } from 'react';

const CropPrediction = () => {
  const [ph, setPh] = useState('');
  const [nitrogen, setNitrogen] = useState('');
  const [phosphorus, setPhosphorus] = useState('');
  const [potassium, setPotassium] = useState('');
  const [hydration, setHydration] = useState('');
  const [cropResult, setCropResult] = useState('');

  const handleSubmit = () => {
    // You can implement your crop prediction logic here.
    // For the sake of this example, we'll simply set a result.
    const result = 'Wheat';

    setCropResult(result);
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-semibold text-center mb-4">Crop Prediction</h1>
      <div className="bg-blue-100 p-6 rounded-lg shadow-lg">
        <div className="grid grid-cols-2 gap-4">
          <div className="col-span-2 sm:col-span-1">
            <label className="block text-gray-700 font-bold mb-2" htmlFor="ph">pH Value:</label>
            <input
              type="text"
              id="ph"
              placeholder="Enter pH Value"
              className="w-full bg-white rounded-lg p-2 outline-none"
              value={ph}
              onChange={(e) => setPh(e.target.value)}
            />
          </div>
          <div className="col-span-2 sm:col-span-1">
            <label className="block text-gray-700 font-bold mb-2" htmlFor="nitrogen">Nitrogen Value:</label>
            <input
              type="text"
              id="nitrogen"
              placeholder="Enter Nitrogen Value"
              className="w-full bg-white rounded-lg p-2 outline-none"
              value={nitrogen}
              onChange={(e) => setNitrogen(e.target.value)}
            />
          </div>
          <div className="col-span-2 sm:col-span-1">
            <label className="block text-gray-700 font-bold mb-2" htmlFor="phosphorus">Phosphorus Value:</label>
            <input
              type="text"
              id="phosphorus"
              placeholder="Enter Phosphorus Value"
              className="w-full bg-white rounded-lg p-2 outline-none"
              value={phosphorus}
              onChange={(e) => setPhosphorus(e.target.value)}
            />
          </div>
          <div className="col-span-2 sm:col-span-1">
            <label className="block text-gray-700 font-bold mb-2" htmlFor="potassium">Potassium Value:</label>
            <input
              type="text"
              id="potassium"
              placeholder="Enter Potassium Value"
              className="w-full bg-white rounded-lg p-2 outline-none"
              value={potassium}
              onChange={(e) => setPotassium(e.target.value)}
            />
          </div>
          <div className="col-span-2">
            <label className="block text-gray-700 font-bold mb-2" htmlFor="hydration">Hydration Value:</label>
            <input
              type="text"
              id="hydration"
              placeholder="Enter Hydration Value"
              className="w-full bg-white rounded-lg p-2 outline-none"
              value={hydration}
              onChange={(e) => setHydration(e.target.value)}
            />
          </div>
          <div className="col-span-2">
            <button
              className="bg-blue-500 hover:bg-blue-600 text-white p-3 rounded-lg "
              onClick={handleSubmit}
            >
              Submit
            </button>
          </div>
        </div>
      </div>
      {cropResult && (
        <div className="mt-4">
          <p className="text-center text-xl font-semibold text-green-700">Recommended Crop: {cropResult}</p>
        </div>
      )}
    </div>
  );
};

export default CropPrediction;
